import { useState } from 'react';
import './App.css';
import Login from './components/Login';
import Register from './components/Register'
function App() {
  let [istoggle, setIsToggle] = useState(true)

  return (
    <div className='app'>
      <div className='mainContent'>
        <button 
        onClick={()=>{
          setIsToggle(false)
        }}>Register</button>

        <button 
        onClick={()=>{
          setIsToggle(true)
        }}>Login</button>
        <Register/>
        <Login />
      </div>
    </div>
  );
}

export default App;
